import './App.css';

function App() {
  return (
    <main>
      <header>
        <nav>
          <a href="" className="logo">El Inversionario</a>
          <div>
            <a href="">Inversiones</a>
            <a href="">Finanzas</a>
            <a href="">Negocios</a>
            <a href="">Ecomomia</a>
            <a href="">Bancario</a>
          </div>
        </nav>
      </header>
    </main>
  );
}

export default App;
